import React from "react";

const RoleItem = (data) => {
  console.log(data);

  return (
    <div
      style={{
        border: "1px solid black",
        display: "flex",
        padding: "10px",
        margin: "20px",
      }}
    >
      <div
        style={{ border: "1px solid red", width: "100px", marginRight: "30px" }}
      >
        Icon
      </div>
      <div style={{ width: "100%" }}>
        <div style={{ display: "flex", justifyContent: "space-between" }}>
          <div>{data.nome}</div>
          <div>Maps</div>
        </div>
        <div style={{ display: "flex" }}>{data.categoria}</div>
        <div
          style={{ display: "flex" }}
        >{`Possui espaço kids? ${data.kids}`}</div>
        <div style={{ display: "flex", justifyContent: "flex-end" }}>
          <div>Nota</div>
          <div>Preço</div>
        </div>
      </div>
    </div>
  );
};

export default RoleItem;
